import React from 'react';

const Work2 = () => {
    return (
        <div id='work2' className='tc dib br3 pa3 ma2 grow bw2 shadow-5 w-75'>
            <p>June '16 - January '18 || 20 months</p>
            <hr></hr>
            <h6>Testing & Validation Scientist</h6>
            <hr></hr>
            <p>HealthQ Technologies</p>
            <p>Role:</p>
            <p>In this role, I tested and validated biometric wearable-devices and health-tracking algorithms.</p>
            <p>My responsibilities included the execution of testing protocols (e.g VO2 Max tests), collecting and handling biometric data as well as plotting and analysing this data (using Python).</p>
            <p>I also wrote scientific research reports and literature reviews as a part of the Biology Team.</p>
        </div>
    );
}

export default Work2;
